import './App.css';
import React, { useRef } from "react";
import styled from 'styled-components'
import Experiencias from './components/Experiencias'
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Projeto from './components/Projeto'
import Desenho from './imagens/desenho.png'
import Experiencia from './imagens/desenho2.png'
import ProjetoImagem from './imagens/desenho3.png'
import SiteProjeto from '../src/imagens/site-gif.gif'
import Labefy from '../src/imagens/labefy.gif' //ate aqui meu
import { makeStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';
import InfoIcon from '@material-ui/icons/Info';


const ImgProject = styled.img`
  height: 400px;
  @media (max-width: 650px) {
    width: 100%;
    height: 200px;
  }
`

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 500,
    height: 450,
  },
  icon: {
    color: 'rgba(255, 255, 255, 0.54)',
  },
}));

export default function App() {

  const classes = useStyles();

  const myRefQuemSou = useRef(null)
  const executeScroll = () => myRefQuemSou.current.scrollIntoView()
  const myRefProjetos = useRef(null)
  const executeScroll1 = () => myRefProjetos.current.scrollIntoView()
  const myRefContato = useRef(null)
  const executeScroll2 = () => myRefContato.current.scrollIntoView()

  return (
    <div className="App">
      <header className="App-Bar">
        <div>
          <p className="carolaine">Carolaine</p>
        </div>

        <div className="App-link">
          <p onClick={executeScroll} className="quem-sou">quem sou</p>
          <p onClick={executeScroll1} className="quem-sou">projetos</p>
          <p onClick={executeScroll2} className="quem-sou">contato</p>
        </div>
      </header>

      <div className="sobre-mim">
        <h1>Carolaine Viana</h1>
        <h2>Desenvolvedora Web Junior</h2>
        <p className="sobre-mim-text">
          <h1>Sobre mim</h1>
              Meu nome é carolaine, tenho 23 anos, sou formada em Sistema de informacao pela Unisales.
              Fiz vários estágios na area de tecnologia, margitoriamente em Suporte.
              Estou buscando uma oportunidade na area de desenvolvimento.
              Meu nome é Daniel, estou a muitos anos na área de pecuária de corte. Depois de 12 anos na fazenda, queria fazer algo diferente e resolvi fazer faculdade de Análise e Desenvolvimento de Sistemas, assim descobri minha paixão por desenvolvimento web. Primeiro aprendi Python com Flask, fui pulando várias tecnologias até fazer o curso da Dr Angela Yu The Complete 2020 Web Development Bootcamp (Udemy). Fiz dezenas de cursos pela net. Finalmente entrei em um curso Fullstack da Labenu em qual aprendi react, typescript, por 6 meses fiz muitos projetos, além disso aprendi orientação a objeto, arquitetura em camadas e infraestrutura da AWS. Agora estou a procura da primeira oportunidade de trabalho na área de desenvolvimento web Fullstack
              </p>
        <ImgProject src={Desenho} />
      </div>

      <div className="skills">
        <div className="skill1">
          <h3>Desenvolvimento de aplicações web utilizando React, HTML, CSS e JavaScript.</h3>
        </div>
        <div className="skill2">
          <h3>Desenvolvimento de aplicações web utilizando React, HTML, CSS e JavaScript.</h3>
        </div>
      </div>


      <div className="education">
        <div className="education1">
          <h2>Bacharel em sistema da informacao</h2>
        </div>
        <div className="education2">
          <h2>Certificacao Scrum Foundation</h2>
        </div>
        <div className="education3">
          <h2>Web Full Stack na Labenu</h2>
        </div>
      </div>

      <div className="experiences">
        <ImgProject src={Experiencia} />
        <div className="card">
          <Experiencias
            cargo={'estagiaria'}
            empresa={'Time now engenharia'}
            descricao={'bldplpadlapdssad'}
          />
          <div className="card">
            <Experiencias
              cargo={'teste2'}
              empresa={'teste4'}
              descricao={'teste5'}
            />
          </div>
          <div className="card">
            <Experiencias
              cargo={'aaa'}
              empresa={'aaa'}
              descricao={'aaaaa'}
            />
          </div>
          <div className="card">
            <Experiencias
              cargo={'eeeee'}
              empresa={'eee'}
              descricao={'eeeeee'}
            />
          </div>
        </div>
      </div>

      {/* <div className="projetos-intro">
        <ImgProject src={ProjetoImagem} />
        <div>
          <p>testeeeeeeeeeee</p>
        </div>
      </div>

      <div className="projetos">
        <Projeto
          nomeProjeto={'Site - moradia universitária'}
          descricaoProjeto={'Objetivo de fazer um site com imoveis alugar para estudantes universitários.'}
          requisitosProjeto={'teste4'}
        />
      </div>

      <ImgProject src={SiteProjeto} alt={'icone'} />


      <div className="projetos">
        <Projeto
          nomeProjeto={'Labefy'}
          descricaoProjeto={'construção de uma playlist de músicas.'}
          requisitosProjeto={'React.js, API Postman, Material-UI'}
        />
      </div>
      <ImgProject src={Labefy} alt={'icone'} /> */}

<div className={classes.root}>
      <GridList cellHeight={180} className={classes.gridList}>
        <GridListTile key="Subheader" cols={2} style={{ height: 'auto' }}>
          <ListSubheader component="div">December</ListSubheader>
        </GridListTile>
        {tileData.map((tile) => (
          <GridListTile key={tile.img}>
            <img src={tile.img} alt={tile.title} />
            <GridListTileBar
              title={tile.title}
              subtitle={<span>by: {tile.author}</span>}
              actionIcon={
                <IconButton aria-label={`info about ${tile.title}`} className={classes.icon}>
                  <InfoIcon />
                </IconButton>
              }
            />
          </GridListTile>
        ))}
      </GridList>
    </div>



</div>
)

}
